namespace OnlineFaceDecetion
{
    class Program
    {
        // 调用getAccessToken()获取的 access_token建议根据expires_in 时间 设置缓存
        // 返回token示例
        public static string access_token = "";

        // 百度云中开通对应服务应用的 API Key 建议开通应用的时候多选服务
        private static string clientId = "7GLoNSeBYpVq5XYALtcF4e2E";
        // 百度云中开通对应服务应用的 Secret Key
        private static string clientSecret = "N8xZQGf8GgMqDQXorbeLSr4YBQfoRgAp";

        public static string GetAccessToken()
        {
            string authHost = "https://aip.baidubce.com/oauth/2.0/token?grant_type=client_credentials&client_id=7GLoNSeBYpVq5XYALtcF4e2E&client_secret=N8xZQGf8GgMqDQXorbeLSr4YBQfoRgAp";
            HttpClient client = new HttpClient();
            List<KeyValuePair<string, string>> paraList = new List<KeyValuePair<string, string>>
            {
                new KeyValuePair<string, string>("grant_type", "client_credentials"),
                new KeyValuePair<string, string>("client_id", clientId),
                new KeyValuePair<string, string>("client_secret", clientSecret)
            };

            HttpResponseMessage response = client.PostAsync(authHost, new FormUrlEncodedContent(paraList)).Result;
            string result = response.Content.ReadAsStringAsync().Result;
            return result;
        }

        public static string DetectDemo()
        {
            string token = access_token;
            string host = "https://aip.baidubce.com/rest/2.0/face/v3/detect?access_token=" + token;
            Encoding encoding = Encoding.Default;
            HttpWebRequest request = (HttpWebRequest)WebRequest.Create(host);
            request.Method = "post";
            request.KeepAlive = true;
            string str = "{\"image\":\"\"," +
                            "\"image_type\":\"BASE64\",\"face_field\":\"age,beauty,expression,eye_status,emotion,faceshape,facetype\",\"max_face_num\":1,\"face_type\":\"LIVE\",\"liveness_control\":\"NONE\"}";
            byte[] buffer = encoding.GetBytes(str);
            request.ContentLength = buffer.Length;
            request.GetRequestStream().Write(buffer, 0, buffer.Length);
            HttpWebResponse response = (HttpWebResponse)request.GetResponse();
            StreamReader reader = new StreamReader(response.GetResponseStream(), Encoding.Default);
            string result = reader.ReadToEnd();
            Console.WriteLine("人脸检测与属性分析:");
            Console.WriteLine(result);
            return result;
        }

        static void Main(string[] args)
        {
            string jsonClientStr = GetAccessToken();
            JsonClientData jd = JsonConvert.DeserializeObject<JsonClientData>(jsonClientStr);
            access_token = jd.Access_token;
            DetectDemo();
            /*
            Console.WriteLine(jd.Refresh_token);
